import React from 'react';
import './App.css';
import Home from './Component/Home'
import Listing from './Component/Listing'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (

<Router>
<div>
  <ul>
    <li>
      <Link to="/Home">About</Link>
    </li>
    <li>
      <Link to="/Home">About</Link>
    </li>
  </ul>

  <Switch>
    <Route path="/Home">
      <Home />
    </Route>

    <Route path="/Listing">
      <Listing />
    </Route>

  </Switch>
</div>
</Router>
  );
}

export default App;
